import "./style.css"
import "./../../img/main-page.png";
import "./../../img/main-page2.png";
import "./../../img/main-page3.png";
import "./../../img/main-page4.png";
import "./../../img/main-page5.png";
import "./../../img/main-page6.png";
import "./../../img/main-page7.png";
const Main = () => {
    return (  
          <div className="Main">        
            <div className="text">
                <p>Путеводитель по интересным местам КубГАУ</p>
            </div>
            <div className="row">
                <div className="column">
                  <img src={main-page} alt="1"/>;  
                </div>
            </div>
            </div>
        
    );
}
 
export default Main;
